import React from "react";
import Card from "../UI/Card";
import "./Card_Galeria.css";
import imagen from "../../imagenes/1.jpg";
const CardGaleria = (props) => {
	return (
		<Card className="col-lg-5 ml-5">
			<div className="card text-center col-lg-4">
				<div className="card-header">Salida a Sevilla</div>
				<div className="card-body">
					<a href="#">
						<img src={imagen} className="img-fluid" alt="" />
					</a>
				</div>
				<div className="card-footer text-muted">2 days ago</div>
			</div>
		</Card>
	);
};

export default CardGaleria;
